with open('clf_xgb.pkl', 'rb') as file:
    loaded_model = pickle.load(file)

# Create columns for inputs
col1, col2 = st.columns(2)

with col1:
    Age = st.number_input("Age", min_value=18, max_value=100, step=1, value=50)
    SEC = st.number_input("SEC", min_value=0, max_value=1, step=1, value=0)
    Arrythmia_proceding_EPS = st.number_input("Arrythmia_proceding_EPS",  min_value=1, max_value=3, step=1, value=1)
    Atherosclerosis_distribution = st.number_input("Atherosclerosis_distribution",  min_value=0, max_value=2, step=1, value=0)
    CHF = st.number_input("CHF", min_value=0, max_value=1, step=1, value=0)
    DM = st.number_input("DM", min_value=0, max_value=1, step=1, value=0)
    Age_75 = st.number_input("Age_75", min_value=0, max_value=1, step=1, value=0)
    CHADS2_VASC = st.number_input("CHADS2_VASC", min_value=0, max_value=9, step=1, value=0)
    LA_diam = st.number_input("LA_diam", min_value=1, max_value=100, step=1, value=1)
    Valvular_Dz = st.number_input("Valvular_Dz", min_value=0, max_value=1, step=1, value=0)


with col2:
    Sex = st.number_input("Sex", min_value=0, max_value=1, step=1, value=0)
    EP_Procedure = st.number_input("EP_Procedure", min_value=1, max_value=3, step=1, value=1)
    Katz_score = st.number_input("Katz_score",  min_value=1, max_value=5, step=1, value=1)
    AV_calcification = st.number_input("AV_calcification", min_value=0, max_value=20, step=1, value=0)
    HTN = st.number_input("HTN", min_value=0, max_value=1, step=1, value=0)
    CVA = st.number_input("CVA", min_value=0, max_value=1, step=1, value=0)
    Vascular_Dz = st.number_input("Vascular_Dz", min_value=0, max_value=1, step=1, value=0)
    LVEF = st.number_input("LVEF", min_value=1, max_value=100, step=1, value=1)
    Age_65 = st.number_input("Age_65", min_value=0, max_value=1, step=1, value=0)
    Anticoag = st.number_input("Anticoag", min_value=1, max_value=9, step=1, value=1)
    
# You can use different types of inputs based on your model requirements

if st.button('Predict'):
    # Prepare the feature vector for prediction
    # This step will depend on your model's requirements
    feature_vector = [Age, Sex, SEC, EP_Procedure, Arrythmia_proceding_EPS, Katz_score, Atherosclerosis_distribution, AV_calcification, HTN, CHF, CVA, DM, Vascular_Dz, Age_75, Age_65, CHADS2_VASC, Anticoag, LA_diam, LVEF, Valvular_Dz]

    # Make prediction
    prediction = loaded_model.predict([feature_vector])

    # Display the prediction

    if prediction[0] == 0:
        st.write(f'The probability of LAA clot is LOW' )
    else:
        st.write(f'The probability of LAA clot is HIGH')
